module.exports = "<!--The content below is only a placeholder and can be replaced.-->\r\n<div class=\"home__content\">\r\n    <div class=\"home__title-container\">\r\n        <img class=\"home__title-icon\" alt=\"Angular Logo\" src=\"data:image/svg+xml;base64,\">\r\n        <h1 class=\"home__title\" joyrideStep=\"title\" title=\"Page Title\" text=\"Main title.\">ngx-joyride</h1>\r\n    </div>\r\n    <h2 class=\"home__subtitle\">A pure Angular directive to build web-app tours</h2>\r\n    <p class=\"home__description\">Let your users learn how to use your application, help them to discover and try out the new features, guiding them through\r\n        a Tour. ngx-joyride is written entirely in Angular without any heavy external dependencies like jquery or Bootstrap.\r\n    </p>\r\n    <joyrideStep joyrideStep=\"central\" title=\"Central Step\" text=\"I'm a central step, without any target.\" stepPosition=\"center\"></joyrideStep>\r\n    <div class=\"home__sections\">\r\n        <div class=\"home__section\">\r\n            <div class=\"home__section-title\">Features</div>\r\n            <ul>\r\n                <li>No external dependencies, pure Angular.</li>\r\n                <li>Scrolls automatically to the target element.</li>\r\n                <li>Autofixes the step position if the step is drawn outside of the document.</li>\r\n                <li>Custom content: you can easily add your Angular components inside the steps' body.</li>\r\n                <li>Multi pages navigation.</li>\r\n                <li>AOT compliant.</li>\r\n            </ul>\r\n        </div>\r\n        <div class=\"home__section\">\r\n            <div class=\"home__section-title\">\r\n                <img src=\"assets/gear.svg\" style=\"padding-right: 5px\">\r\n                <div>Options</div>\r\n            </div>\r\n            <ul class=\"home__options\">\r\n                <li>Theme colour\r\n                    <input class=\"home__colour-picker\" cpPosition=\"left\" [(colorPicker)]=\"color\" [style.background]=\"color\" />\r\n                </li>\r\n                <li>\r\n                    <mat-slide-toggle color=\"blue\" [checked]=\"true\" [disabled]=\"false\" labelPosition=\"before\" (change)=\"counterToggleChanged($event)\">\r\n                        Show counter\r\n                    </mat-slide-toggle>\r\n                </li>\r\n                <li>\r\n                    <mat-slide-toggle color=\"blue\" [checked]=\"true\" [disabled]=\"false\" labelPosition=\"before\" (change)=\"prevButtonToggleChanged($event)\">\r\n                        Show \"Prev\" button\r\n                    </mat-slide-toggle>\r\n                </li>\r\n\r\n                <li>\r\n                    Default step position:\r\n                    <mat-form-field style=\"width: 70px\">\r\n                        <mat-select [(value)]=\"selected\">\r\n                            <mat-option *ngFor=\"let position of positions\" [value]=\"position\" selected=\"top\">\r\n                                {{ position }}\r\n                            </mat-option>\r\n                        </mat-select>\r\n                    </mat-form-field>\r\n                </li>\r\n            </ul>\r\n            <button class=\"home__button\" joyrideStep=\"firstStep\" title=\"Start the tour\" text=\"Once clicked this button the Tour starts.\r\n                \" (click)=\"onClick()\">Start the Tour</button>\r\n        </div>\r\n    </div>\r\n</div>"

